function makeLink(){const g=Joomla.getOptions("variables",{}),e=document.getElementById("filter_campusID"),f=document.getElementById("filter_categoryID"),a=document.getElementById("filter_groupID"),i=document.getElementById("filter_methodID"),d=document.getElementById("list_languageTag"),c=document.getElementById("filter_organizationID"),h=document.getElementById("filter_personID"),b=document.getElementById("filter_roomID");let url=g.ICS_URL,campusID,methodID,my,organizationID,roomID;if(typeof g.my!=="undefined"&&typeof g.auth!=="undefined"&&typeof g.username!=="undefined"){url+="&auth="+g.auth+"&my=1&username="+g.username}else{if(typeof g.campusID!=="undefined"){campusID=g.campusID}else{if(e!==null&&e.value){campusID=e.value}}if(typeof campusID!=="undefined"){url+="&campusID="+campusID}if(f!==null&&f.value){url+="&categoryID="+f.value}if(typeof g.dow!=="undefined"){url+="&dow="+g.dow}if(a!==null&&a.value){url+="&groupID="+a.value}if(d!==null&&d.value){url+="&languageTag="+d.value}if(typeof g.methodID!=="undefined"){methodID=g.methodID}else{if(i!==null&&i.value){methodID=i.value}}if(typeof methodID!=="undefined"){url+="&methodID="+methodID}if(typeof g.organizationID!=="undefined"){organizationID=g.organizationID}else{if(c!==null&&c.value){organizationID=c.value}}if(typeof organizationID!=="undefined"){url+="&organizationID="+organizationID}if(h!==null&&h.value){url+="&personID="+h.value}if(b!==null&&b.value){url+="&roomID="+b.value}}window.prompt(Joomla.JText._("ORGANIZER_GENERATE_LINK"),url);return};